-- desc:   A Hex-tile  strategy game. Sprites and some code by Balistic Ghouls Studios and Some code by Get bonus Games
-- script: lua

HEX_W=20
HEX_SZ=10+3

function hex_to_px(q, r)
 local sqr3=math.floor(math.sqrt(3))+0.7
 local x = HEX_SZ * (sqr3 * q  + sqr3/2 * r)
 local y = HEX_SZ * (              3./2 * r)
 return x, y
end

function spr_qr(n, q, r)
 local x, y = hex_to_px(q, r)
	spr(n,x+3,y+3,8,1,0,0,2,2)
end

MH=6
MW=10
function draw_hex_map(mx, my)
	for q=-MH, MW-1 do
  for r=0, MH-1 do
		 local x, y = hex_to_px(q, r)
			if x >= 0 and y >= 0 and x+HEX_W <= 30*8 and y+HEX_W <= 15*8 then
				local ms=mget(mx+q, my+r)
				if ms > 0 then
 			 spr(ms-17, x, y, 0, 1, 0, 0, 3, 3)
				end
			end
		end
	end
end

pq=nil
pr=nil

function start_level()
 local lvl=LVLS[level]
	pq=lvl.p_s.pq
	pr=lvl.p_s.pr
end

function TIC()

	if btnp(0) then pr=pr-1 end
	if btnp(1) then pr=pr+1 end
	if btnp(2) then pq=pq-1 end
	if btnp(3) then pq=pq+1 end
	

	cls(0)
	
	local lvl=LVLS[level]
	
	draw_hex_map(lvl.x, lvl.y)
	
	--LV 3
