 for _, en in pairs(lvl.ene) do
	 spr_qr(en.s, en.x, en.y)
	end
	for _, ev in pairs(lvl.env) do
	 spr_qr(ev.s, ev.x, ev.y)
	end
	
	spr_qr(262, pq, pr)
	
end

